import React, { useState } from "react";
import { experienceData } from "./experienceData";
import SectionTitle from "../SectionTitles";

function Experience() {
  const [selectedExperience, setSelectedExperience] = useState(
    experienceData[0]
  );

  return (
    <div className="experience-section">
      <SectionTitle name="Experience" />
      <div className="experience-container">
        <div className="left-toolbar">
          <ul>
            {experienceData.map((experience, index) => (
              <li key={index} onClick={() => setSelectedExperience(experience)}>
                {experience.title}
              </li>
            ))}
          </ul>
        </div>
        <div className="right-description">
          <div className="header-section">
            <div className="title-dates">
              <h2>{selectedExperience.title}</h2>
              <p>{selectedExperience.dates}</p>
            </div>
            <img
              src={selectedExperience.companyLogo}
              alt="Company Logo"
              className="company-logo"
            />
          </div>
          <ul className="description-bullets">
            {selectedExperience.description.map((bullet, index) => (
              <li key={index}>{bullet}</li>
            ))}
          </ul>
          <p>Technologies Used: {selectedExperience.technologies}</p>
        </div>
      </div>
    </div>
  );
}

export default Experience;
